import React from "react";
import styled from "styled-components";

const Container = styled.div``;

const CategoryItem = ({ item }) => {
	return (
		<Container>
			<Image />
			<Info>
				<Title>{item.img}</Title>
				<Button>Comprar agora</Button>
			</Info>
		</Container>
	);
};

export default CategoryItem;
